import React, { useState } from 'react';
import { Container, Row, Col, Card, Form, Button, Alert } from 'react-bootstrap';
import { testsAPI } from '../services/api';

function Home() {
  const [candidateData, setCandidateData] = useState({
    candidate_name: '',
    candidate_email: '',
    question_count: 10
  });
  const [loading, setLoading] = useState(false);
  const [alert, setAlert] = useState(null);

  const handleInputChange = (e) => {
    setCandidateData({
      ...candidateData,
      [e.target.name]: e.target.value
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setAlert(null);

    try {
      const response = await testsAPI.createSession(candidateData);
      const { session_token } = response.data;
      
      // Redirect to test page
      window.location.href = `/test/${session_token}`;
    } catch (error) {
      setAlert({
        type: 'danger',
        message: error.response?.data?.error || 'Failed to create test session'
      });
    } finally {
      setLoading(false);
    }
  };

  return (
    <Container>
      <Row className="justify-content-center">
        <Col md={8} lg={6}>
          <div className="test-header text-center">
            <h1>VLSI Interview Assessment</h1>
            <p className="mb-0">
              Test your knowledge of Very Large Scale Integration (VLSI) concepts
            </p>
          </div>

          <Card>
            <Card.Body>
              <Card.Title>Start Your Interview Test</Card.Title>
              <Card.Text>
                You will be presented with 10 randomly selected VLSI questions. 
                Please answer all questions to the best of your ability.
              </Card.Text>

              {alert && (
                <Alert variant={alert.type} className="mb-3">
                  {alert.message}
                </Alert>
              )}

              <Form onSubmit={handleSubmit}>
                <Row>
                  <Col md={6}>
                    <Form.Group className="mb-3">
                      <Form.Label>Full Name *</Form.Label>
                      <Form.Control
                        type="text"
                        name="candidate_name"
                        value={candidateData.candidate_name}
                        onChange={handleInputChange}
                        required
                        placeholder="Enter your full name"
                      />
                    </Form.Group>
                  </Col>
                  <Col md={6}>
                    <Form.Group className="mb-3">
                      <Form.Label>Email Address *</Form.Label>
                      <Form.Control
                        type="email"
                        name="candidate_email"
                        value={candidateData.candidate_email}
                        onChange={handleInputChange}
                        required
                        placeholder="Enter your email"
                      />
                    </Form.Group>
                  </Col>
                </Row>

                <Form.Group className="mb-3">
                  <Form.Label>Number of Questions</Form.Label>
                  <Form.Select
                    name="question_count"
                    value={candidateData.question_count}
                    onChange={handleInputChange}
                  >
                    <option value={5}>5 Questions</option>
                    <option value={10}>10 Questions</option>
                    <option value={15}>15 Questions</option>
                    <option value={20}>20 Questions</option>
                  </Form.Select>
                </Form.Group>

                <div className="d-grid">
                  <Button
                    variant="primary"
                    type="submit"
                    size="lg"
                    disabled={loading}
                  >
                    {loading ? 'Creating Test...' : 'Start Test'}
                  </Button>
                </div>
              </Form>
            </Card.Body>
          </Card>

          <Card className="mt-4">
            <Card.Body>
              <Card.Title>Instructions</Card.Title>
              <ul>
                <li>Read each question carefully before answering</li>
                <li>Type your answers in the text areas provided</li>
                <li>You can navigate between questions using the Next/Previous buttons</li>
                <li>Make sure to submit all answers before completing the test</li>
                <li>Your responses will be automatically graded against correct answers</li>
              </ul>
            </Card.Body>
          </Card>
        </Col>
      </Row>
    </Container>
  );
}

export default Home;
